import React, { Component } from 'react';

class Home extends Component {
  render() {
    return (
      <div className="align-center">
        <h2 className="text-center">Chào mừng bạn đến với cửa hàng mua bán thú cưng</h2>

      </div>
    );
  }
}
export default Home;
